const ListData = (props) => {
  const catg = props.data;
  const clickedItem = (event) => {
    alert(event.value);
    console.log(event.currentTarget).dataset;
  };
  return (
    <ul class="list-group">
      {catg &&
        catg.length > 0 &&
        catg.map((catg, index) => (
          <li
            class="list-group-item"
            key={catg.id}
            onClick={clickedItem}
            id={Math.random()}
          >
            {catg.name}
          </li>
        ))}
    </ul>
  );
};

export default ListData;
